import React from 'react';
import './Datathon.css';

function Datathon() {
    return (
        <div class="datathon">
            <div class="heading">
                <p class="title"> Blueprint Datathon </p>
                <p class="subtitle"> Subtitle goes here </p>
                <div class="icon-row">
                    <IconButton link="https://linkedin.com/in/izzielau" icon=<i class="fa fa-linkedin"/> />
                    <IconButton link="https://github.com/izzielau" icon=<i class="fa fa-github"/> />
                </div>

            </div>
            <div class="content">
                <p class="text"> Text </p>
            </div>
        </div>
    );
}

export default Datathon;
